import React, { useContext } from 'react'
import styled, { ThemeContext } from 'styled-components'

const IconWrapper = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  width: ${({ size }) => size};
  min-width: ${({ size }) => size};
  height: ${({ size }) => size};
  cursor: ${({ pointer }) => (pointer ? 'pointer' : 'inherite')};
  transition: all 0.3s;

  @media (max-width: 1140px) {
    width: ${({ size, mobileSize }) => mobileSize || size};
    min-width: ${({ size, mobileSize }) => mobileSize || size};
    height: ${({ size, mobileSize }) => mobileSize || size};
  }

  svg {
    transition: all 0.3s;
  }

  svg:not(.stroke) {
    width: 100%;
    height: 100%;
    fill: ${({ color }) => color};

    ${({ hoverColor }) =>
      hoverColor &&
      `
			&:hover {
				fill: ${hoverColor};
			}
		`};
  }
  svg.stroke {
    width: 100%;
    height: 100%;
    stroke: ${({ color }) => color};

    ${({ hoverColor }) =>
      hoverColor &&
      `
			&:hover {
				stroke: ${hoverColor};
			}
		`};
  }
`

const Icon = ({
  icon = 'default',
  size = '16px',
  mobileSize,
  color = 'dark',
  hoverColor,
  onClick,
  style,
}) => {
  const theme = useContext(ThemeContext)
  return (
    <IconWrapper
      size={size}
      mobileSize={mobileSize}
      onClick={() => onClick && onClick()}
      color={theme.colors[color]}
      hoverColor={theme.colors[hoverColor]}
      pointer={!!onClick}
      style={style}
    >
      {ICONS[icon]()}
    </IconWrapper>
  )
}

export default Icon

